import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";

function UserList(userInfo) {
  const navigate = useNavigate();
  //   const [userName, setUserName] = useState(userInfo.userProfileId.userName);
  //   const [userPic, setUserPic] = useState(userInfo.userProfilePicPath);
  //   const [admin, setAdmin] = useState(userInfo.userIsAdmin);
  const setAdmin = (target) => {};
  return (
    <tr className="set_admin_user_box">
      <td>
        <input className="chk_user_list" type="checkbox"></input>
      </td>
      <td>
        <img
          className="user_pic"
          src={process.env.PUBLIC_URL + userInfo.userInfo.userProfilePicPath}
          style={{ margin: "20px", width: "50px", height: "50px" }}
          alt=""
        ></img>
      </td>
      <td className="user_name">{userInfo.userInfo.userProfileId.userName}</td>
      <td className="user_is_admin_box">
        <input type="checkbox" checked={userInfo.userInfo.userIsAdmin !== null ? true : ""} />
        <label>관리자</label>
      </td>
    </tr>
  );
}
export default UserList;
